import Navbar from '../components/Navbar';
import Head from 'next/head'

function Home() {
  return (
    <>
      <Head>
        <title>LV - Home</title>
      </Head>

      <Navbar />

      <section className="hero">
        <div className="container">
          <img src="/web-developer.jpeg" alt="home-image" />
          <div className="text-wrapper">
            <h1 className="title">Hi there, my name is Liam Volschenk</h1>
            <p className="description">I am an aspiring web developer, photographer, designer, problem solver and forward thinker</p>

          </div>
        </div>
      </section>
    </>
  );
}

export default Home;
